  console.log(listItems);

  Hook(setItemList);
  return (
    <div className="home--page">
      <div className="header--page">
        <div>
          <h1>Logo</h1>
        </div>
        <div>
          <span>&times;</span>
        </div>
      </div>
      <div className="home--body"> items</div>
    </div>
  );
};

export { Home };
